import './Profile.scss'
import FacebookOutlinedIcon from '@mui/icons-material/FacebookOutlined';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import InstagramIcon from '@mui/icons-material/Instagram';
import TwitterIcon from '@mui/icons-material/Twitter';
import LanguageIcon from '@mui/icons-material/Language';
import MarkunreadIcon from '@mui/icons-material/Markunread';
import PinterestIcon from '@mui/icons-material/Pinterest';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import MoreVertIcon from '@mui/icons-material/MoreVert';

const Profile = () => {
  return (
    <div className='profile'>
      <div className="images">
        <img src="https://images.pexels.com/photos/4947406/pexels-photo-4947406.jpeg?auto=compress&cs=tinysrgb&w=600 " alt="" className='cover'/>
        <img src="https://images.pexels.com/photos/1325619/pexels-photo-1325619.jpeg?auto=compress&cs=tinysrgb&w=600" alt="" className='profilePic' />
      </div>
      <div className="profileContainer">
          <div className="uInfo">
            <div className="left">
              <FacebookOutlinedIcon/>
              <LinkedInIcon/>
              <InstagramIcon/>
              <TwitterIcon/>
              <PinterestIcon/>
            </div>
            <div className="center"></div>
            <div className="right">
            MoreVertIcon
            </div>
          </div>
      </div>
    </div>
  )
}

export default Profile
